Message:
remove now unused {% load url from future %}

This is effectively a no-op in Django 1.5 and was only used in Django 1.4 for
forward-compatability.

Remove incompatible @register.filter w/ @mark_safe

It seems that both cannot be used in the correct order, which would be

    @register.filter
    @mark_safe
    def somefiler(x):
        pass

Because otherwise the following error occurs

    django.template.exceptions.TemplateSyntaxError: somefilter requires 0 arguments, 1 provided

This has not been an issue with Django <2

